    callback : any;
    userAnswer : string;
    questionNo : number ;
    totalQuestions : number;

}



const QuestionCard :React.FC<Props> = ({question, answer, callback, userAnswer, questionNo, totalQuestions,}) => {
  return (
        <div>
            <p className='qno'>
                Questions : {questionNo} / {totalQuestions}
            </p>

            <p dangerouslySetInnerHTML={{}}></p>


        </div>
  )
}

